INSERT INTO `satellite2_node_revisions` (`nid`, `vid`, `uid`, `title`, `body`, `teaser`, `log`, `timestamp`, `format`) VALUES 
(1, 1, 1, 'Test item', '<div>\r\n&quot;My year participation in the Erasmus exchange was highly enjoyable, exciting experience, which broadened my mind, and exceeded all of my expectations&quot; said Timothy, English, who studied in the Netherlands. &quot;One of the best years in my life, <strong>if not the best</strong>&quot; commented Maria, Spanish, who studied in Sweden. \r\n</div>\r\n', '<div>\r\n&quot;My year participation in the Erasmus exchange was highly enjoyable, exciting experience, which broadened my mind, and exceeded all of my expectations&quot; said Timothy, English, who studied in the Netherlands. &quot;One of the best years in my life, <strong>if not the best</strong>&quot; commented Maria, Spanish, who studied in Sweden. \r\n</div>\r\n', '', 1188285357, 1),
(2, 2, 2, 'Editor news item', '<ul>			<li>an li list</li>		<li>with some items</li></ul><div><span style="line-height: 18px" class="Apple-style-span"><ol>			<li>this one an ordered list</li>		<li>and again...</li></ol><div>www.esn.org this is a link test</div><div>http://www.esn.org and another test</div></span></div>', '<ul>			<li>an li list</li>		<li>with some items</li></ul><div><span style="line-height: 18px" class="Apple-style-span"><ol>			<li>this one an ordered list</li>		<li>and again...</li></ol><div>www.esn.org this is a link test</div><div>http://www.esn.org and another test</div></span></div>', '', 1188286792, 1),
(3, 3, 2, 'CND Winterthur', '<p>The CND 2007 will be organised by the local Erasmus Student Network section of Winterthur. Erasmus Student Network (ESN) is a student organisation founded in 1990 for supporting and developing student exchange and international mobility on a voluntarily base.</p><p>Currently, ESN is present in 240 Higher Education Institutions in 33 countries all over Europe. The network is constantly developing and expanding. In Winterthur and Zurich there are currently 50 active students.</p>', '<p>The CND 2007 will be organised by the local Erasmus Student Network section of Winterthur. Erasmus Student Network (ESN) is a student organisation founded in 1990 for supporting and developing student exchange and international mobility on a voluntarily base.</p><p>Currently, ESN is present in 240 Higher Education Institutions in 33 countries all over Europe. The network is constantly developing and expanding. In Winterthur and Zurich there are currently 50 active students.</p>', '', 1188292452, 1),
(6, 6, 1, 'SkyEurope ', 'SkyEurope SkyEurope SkyEurope SkyEurope SkyEurope', 'SkyEurope SkyEurope SkyEurope SkyEurope SkyEurope', '', 1188463652, 1),
(5, 5, 1, 'Another news test', 'Body body Body body Body body Body body Body body Body body Body body Body body Body body Body body Body body Body body Body body', 'Body body Body body Body body Body body Body body Body body Body body Body body Body body Body body Body body Body body Body body', '', 1188425768, 1);
